#[test]
fn test_limbs_mul_fft_normalize_mod_f() {
    let test = |rp_before: Vec<Limb>, n: usize, ap: Vec<Limb>, rp_after: Vec<Limb>| {
        let mut rp = rp_before;
        _limbs_mul_fft_normalize_mod_f(&mut rp, n, &ap);
        assert_eq!(rp, rp_after);
    };
    // xs_len >= 2 * n in _limbs_mul_fft_normalize_mod_f
    test(
        vec![1, 2, 3],
        2,
        vec![4, 5, 6, 7, 8],
        vec![7, u64::MAX - 1, 3],
    );
}

#[cfg(not(feature = "32_bit_limbs"))]
#[test]
fn test_limbs_mul_fft_internal() {
    let test = |op_before: Vec<Limb>,
                pl: usize,
                k: usize,
                ap_before: Vec<Vec<Limb>>,
                b_before: Vec<Limb>,
                l: usize,
                mp: usize,
                fft_l: Vec<Vec<usize>>,
                t_before: Vec<Limb>,
                sqr: bool,
                op_after: Vec<Limb>,
                b_after: Vec<Limb>,
                t_after: Vec<Limb>| {
        let mut op = op_before;
        let mut ap_clone = ap_before.clone();
        let mut ap: Vec<&mut [Limb]> = Vec::with_capacity(ap_before.len());
        for a in &mut ap_clone {
            ap.push(a);
        }
        let mut b = b_before;
        let fft_l: Vec<&[usize]> = fft_l.iter().map(Vec::as_slice).collect();
        let mut t = t_before;
        _limbs_mul_fft_internal(&mut op, pl, k, ap, &mut b, l, mp, &fft_l, &mut t, sqr);
        assert_eq!(op, op_after);
        assert_eq!(b, b_after);
        assert_eq!(t, t_after);
    };
    test(
        vec![1, 2, 3],
        2,
        1,
        vec![vec![4, 5, 6], vec![7, 8, 9]],
        vec![10, 11, 12, 13, 14, 15],
        2,
        3,
        vec![vec![0], vec![1, 2], vec![3, 4, 5, 6]],
        vec![13, 14, 15, 16, 17, 18],
        false,
        vec![9_223_372_036_854_775_669, 0x4000_0000_0000_000c, 3],
        vec![
            18_446_744_073_709_551_457,
            2,
            9_223_372_036_854_775_788,
            13_835_058_055_282_163_703,
            u64::MAX,
            0,
        ],
        vec![0, 0, 0, 18_446_744_073_709_551_458, 1, 0],
    );
}

#[cfg(feature = "32_bit_limbs")]
fn verify_mul_low_1(out_before: &[Limb], xs: &[Limb], ys: &[Limb], out_after: &[Limb]) {
    let n = Natural::from_limbs_asc(xs) * Natural::from_limbs_asc(ys);
    let mut ns = n.into_limbs_asc();
    let len = xs.len();
    ns.resize(len, 0);
    assert_eq!(ns, &out_after[..len]);
    assert_eq!(&out_after[len..], &out_before[len..]);
}

#[cfg(feature = "32_bit_limbs")]
#[test]
fn test_limbs_mul_low_same_length_basecase() {
    let test = |xs: Vec<Limb>, ys: Vec<Limb>, out_before: Vec<Limb>, out_after: Vec<Limb>| {
        let mut out = out_before.clone();
        _limbs_mul_low_same_length_basecase(&mut out, &xs, &ys);
        assert_eq!(out, out_after);

        let mut out = out_before.clone();
        _limbs_mul_low_same_length_basecase_alt(&mut out, &xs, &ys);
        assert_eq!(out, out_after);

        verify_mul_low_1(&out_before, &xs, &ys, &out_after);
    };
    test(vec![2], vec![3], vec![10; 3], vec![6, 10, 10]);
    test(
        vec![1; 3],
        series(1, 3),
        vec![5; 8],
        vec![1, 3, 6, 5, 5, 5, 5, 5],
    );
    test(
        vec![100, 101, 102],
        vec![102, 101, 100],
        vec![10; 7],
        vec![10_200, 20_402, 30_605, 10, 10, 10, 10],
    );
    test(vec![u32::MAX], vec![1], vec![10; 3], vec![u32::MAX, 10, 10]);
    test(
        vec![u32::MAX],
        vec![u32::MAX],
        vec![10; 4],
        vec![1, 10, 10, 10],
    );
    test(
        vec![u32::MAX; 3],
        vec![u32::MAX; 3],
        vec![10; 6],
        vec![1, 0, 0, 10, 10, 10],
    );
}

